packageExtensions:
  babel-preset-react-app@*:
    dependencies:
      "@babel/plugin-proposal-private-property-in-object": "*"
  "@2fd/ant-design-icons@*":
    dependencies:
      tslib: ^2.0.3
  antd-dayjs-webpack-plugin@*:
    dependencies:
      loader-utils: ^2.0.0

plugins:
